INSERT INTO `burger_info` VALUES (41,'스태커2와퍼',4,'믿고 먹을수 있는 와퍼, 더 크게 도전하세요!','burger_1675050655438.png','스태커2','2023-01-02',142),(44,'스태커3와퍼',4,'믿고 먹을수 있는 와퍼, 더 크게 도전하세요!','burger_1675050723505.png','스태커3','2023-01-03',144),(45,'치킨킹BLT',2,'스파이시한 통닭다리살 프리미엄 치킨버거에 베이컨, 양상추, 토마토를 더했다. 치킨킹 BLT!','burger_1675050758898.png','치킨킹BLT','2023-01-10',145),(46,'베이컨치즈와퍼',4,'풍미 가득한 아메리칸 클래식의 완벽한 조화!','burger_1675050763619.png','베이컨치즈와퍼','2023-01-04',152),(47,'치킨킹',2,'스파이시한 통닭다리살과 고소한 브리오쉬번이 만나 더 풍부해진 프리미엄 치킨버거. 치킨킹!','burger_1675050778390.png','치킨킹','2023-01-10',147),(48,'할라피뇨와퍼',4,'','burger_1675050806198.png','할라피뇨와퍼','2023-01-04',162),(49,'BLT오믈렛킹모닝',2,'부드러운 더블오믈렛과 소프트번의 조합','burger_1675050813374.png','BLT오믈렛킹모닝','2023-01-10',149),(50,'오믈렛킹모닝',2,'부드러운 더블오믈렛과 소프트번의 조합','burger_1675050835794.png','오믈렛킹모닝','2023-01-10',150),(51,'블랙어니언와퍼',2,'200분의 기다림으로 만든 블랙 어니언, 더 깊어진 풍미의 와퍼','burger_1675050870194.png','블랙어니언와퍼','2023-01-01',152),(53,'블랙어니언치킨버거',2,'200분의 기다림으로 만든 블랙 어니언, 더 깊어진 풍미의 치킨버거','burger_1675050896681.png','블랙어니언치킨버거','2023-01-01',153),(54,'블랙어니언X',2,'200분의 기다림으로 만든 블랙 어니언, 더 깊어진 풍미의 X','burger_1675050916629.png','블랙어니언X','2023-01-01',154),(55,'와퍼',4,'불에 직접 구운 순 쇠고기 패티에 싱싱한 야채가 한가득~ 버거킹의 대표 메뉴!','burger_1675050934559.png','와퍼','2022-01-01',176),(56,'비프불고기버거',2,'달콤한 불고기소스와 100% 순쇠고기 패티의 감칠맛나는 조화, 비프불고기버거!','burger_1675050941444.png','비프불고기버거','2023-01-01',156),(57,'불고기와퍼',4,'불에 직접 구운 순 쇠고기 패티가 들어간 와퍼에 달콤한 불고기 소스까지!','burger_1675050975426.png','불고기와퍼','2022-01-01',157),(58,'콰트로치즈와퍼',3,'진짜 불맛을 즐겨라, 4가지 고품격 치즈와 불에 직접 구운 와퍼 패티의 만남!','burger_1675050984785.png','콰트로치즈와퍼','2020-05-05',158),(59,'치즈와퍼',3,'불에 직접 구운 순 쇠고기 패티가 들어간 와퍼에 고소한 치즈까지!','burger_1675051013512.png','치즈와퍼','2020-04-03',162),(60,'갈릭불고기와퍼',3,'','burger_1675051039694.png','갈릭불고기와퍼','2021-02-13',189),(61,'통새우와퍼주니어',4,'불맛 가득 순쇠고기, 갈릭페퍼 통새우, 스파이시토마토소스가 더해진 프리미엄 버거\r\n\r\n','burger_1675051044860.png','통새우와퍼주니어','2022-01-01',161),(62,'콰트로치즈와퍼주니어',4,'진짜 불맛을 즐겨라, 4가지 고품격 치즈와 불에 직접 구운 와퍼 패티의 만남!','burger_1675051124589.png','콰트로치즈와퍼주니어','2022-12-28',162),(63,'기네스콰트로치즈와퍼',3,'콰트로치즈와퍼가 기네스를 만나다!','burger_1675051125541.png','기네스콰트로치즈와퍼','2022-04-08',163),(64,'기네스와퍼',3,'기네스 번과 기네스 바비큐 소스의 풍미!','burger_1675051168023.png','기네스와퍼','2022-04-08',164),(66,'몬스터와퍼',3,'불맛 가득 순쇠고기, 치킨, 베이컨에 화끈한 디아블로 소스의 압도적인 맛','burger_1675051196342.png','몬스터와퍼','2022-06-25',166),(67,'몬스터X',3,'부드러운 호밀 브리오슈 번, 두툼한 스테이크 패티, 디아블로 소스의 압도적인 맛','burger_1675051222426.png','몬스터X','2022-06-25',167),(69,'콰트로치즈X',3,'진짜 불맛을 즐겨라, 고품격 치즈와 불에 직접 구운 스테이크 패티의 만남!','burger_1675051254726.png','콰트로치즈X','2020-03-07',169),(70,'통새우와퍼',3,'불맛 가득 순쇠고기, 갈릭페퍼 통새우, 스파이시토마토소스가 더해진 프리미엄 버거','burger_1675051285177.png','통새우와퍼','2020-02-11',170),(71,'불고기와퍼주니어',4,'불에 직접 구운 순 쇠고기 패티가 들어간 와퍼주니어에 달콤한 불고기 소스까지!','burger_1675051289835.png','불고기와퍼주니어','2022-10-01',171),(73,'와퍼주니어',4,'불에 직접 구운 순 쇠고기 패티가 들어간 와퍼의 주니어 버전~ 작지만 꽉 찼다!','burger_1675051448073.png','와퍼주니어','2022-01-01',173),(74,'치즈버거',4,'불에 구운 쇠고기 패티와 사르르 치즈까지, 작지만 알차다!','burger_1675051475743.png','치즈버거','2022-01-01',174),(75,'비프&슈림프버거',5,'불맛가득 순쇠고기 패티에 새콤달콤 루피 특제소스 듬뿍!','burger_1675051550541.png','비프&슈림프버거','2022-10-04',178),(76,'통새우슈림프버거',5,'통통한 통새우에 새콤달콤 루피 특제소스 듬뿍! 통새우 슈림프 버거','burger_1675051590411.png','통새우슈림프버거','2022-06-07',176),(77,'잔망루피슈림프버거',5,'탱글한 새우패티에 새콤달콤 루피 특제소스 듬뿍!','burger_1675051637468.png','잔망루피버거','2022-06-07',180),(78,'롱치킨버거',5,'담백한 치킨 패티에 부드러운 마요네즈 소스와 싱싱한 야채가 듬뿍~','burger_1675051671466.png','롱치킨버거','2022-06-06',178),(79,'킹치킨버거',5,'부드러운 에그번과 킹치킨패티의 만남! 풍부한 마요 소스로 고소하게!','burger_1675051709218.png','킹치킨버거','2022-06-01',179),(80,'바비큐킹치킨버거',5,'진한 바비큐 소스가 가득!','burger_1675051766500.png','바비큐킹치킨버거','2022-04-01',180),(83,'타바스코몬스터',2,'화끈한 타바스코에 직화구이 순쇠고기, 그리고 바삭한 치킨패티까지! 타바스코 몬스터','burger_1675056649379.png','타바스코몬스터','2023-01-20',183),(84,'타바스코더블비프',2,'시그니처 불맛가득 순쇠고기 패티의 풍부한 풍미! 타바스코 더블비프','burger_1675056677447.png','타바스코더블비프','2023-01-20',184),(85,'타바스코슈림프',2,'화끈한 타바스코에 탱글한 새우패티까지 더해졌다! 타바스코 슈림프','burger_1675056714163.png','타바스코슈림프','2023-01-20',269),(86,'치즈와퍼주니어',4,'불에 직접 구운 순 쇠고기 패티가